import React, { useEffect, useState } from 'react';
import API from '../api';

const QuizList = () => {
  const [quizzes, setQuizzes] = useState([]);

  useEffect(() => {
    const fetchQuizzes = async () => {
      try {
        const res = await API.get('/quizzes');
        setQuizzes(res.data);
      } catch (error) {
        alert('Failed to fetch quizzes.');
      }
    };
    fetchQuizzes();
  }, []);

  return (
    <div>
      <h2>All Quizzes</h2>
      {quizzes.map((quiz) => (
        <div key={quiz._id}>
          <p>{quiz.title}</p>
        </div>
      ))}
    </div>
  );
};

export default QuizList;
